import React from 'react';
import './App.css';
import './uikit.css'
import { BrowserRouter as Router} from "react-router-dom";
import NavBar from './NavBar'
import Search from './Search'

function App() {
  return (
    <div className="App">
      <Router>
        <NavBar />
        <Search />
      </Router>
    </div>
  );
}

export default App;
